('tt4012424', 2017, 'O Filme da Minha Vida', 'O Filme da Minha Vida', 'Tony decide voltar para sua cidade natal. Ele descobre que seu pai voltou para a França alegando falta dos seus amigos e do país de origem. Tony acaba se tornando professor e se vê em meio de conflitos e inexperiência.', 14, 7.2, NULL, 'https://m.media-amazon.com/images/M/MV5BMDk3YzRiZjgtNThlMi00N2JiLTllZTItMTc3NTU3MWEyYjM4XkEyXkFqcGdeQXVyMjMzMTYyNzE@._V1_.jpg', 4, '2024-02-01 01:40:11.66', '2024-02-01 01:40:11.66', NULL, NULL, NULL),
