('tt6710474', 2022, 'Everything Everywhere All at Once', 'Tudo em Todo o Lugar ao Mesmo Tempo', 'Uma imigrante chinesa de meia idade se envolve em uma aventura louca, onde só ela pode salvar o mundo explorando outros universos que se conectam com as vidas que ela poderia ter levado.', 14, 7.8, 94, 'https://m.media-amazon.com/images/M/MV5BYjZhZjZhNTctMmMxZS00ZjlmLTgxZGQtMTUyODlmYWJlZWIzXkEyXkFqcGdeQXVyMTU0NDAxNjY1._V1_.jpg', 4, '2024-02-01 01:40:16.9', '2024-02-01 01:40:16.9', 81, NULL, 'https://www.rottentomatoes.com/m/everything_everywhere_all_at_once'),
('tt1950186', 2019, 'Ford v Ferrari', 'Ford vs Ferrari', 'Um designer de carros e um motorista combatem a interferência corporativa, as leis da física e seus próprios demônios pessoais para construir um carro de corrida revolucionário para a Ford e desafiar a Ferrari nas 24 Horas de Le Mans em 1966.', 12, 8.1, 92, 'https://m.media-amazon.com/images/M/MV5BMzliNDUxMDMtYjM4Ny00Y2U2LWE4ZTUtNTE3MjhmNWQ5YTFkXkEyXkFqcGdeQXVyMTAzMDM4MjM0._V1_.jpg', 4, '2024-02-01 01:40:17.324', '2024-02-01 01:40:17.324', 81, 98, 'https://www.rottentomatoes.com/m/ford_v_ferrari'),
('tt9770150', 2020, 'Nomadland', 'Nomadland', 'Uma mulher na casa dos sessenta anos que, depois de perder tudo na Grande Recessão, embarca em uma viagem pelo oeste americano, vivendo como um nômade moderno que vive em uma van.', 12, 7.3, 93, 'https://m.media-amazon.com/images/M/MV5BZWRiM2NmZWItODgwZi00MmIyLTk5ZDAtODNmNzMyMGQ2YTVhXkEyXkFqcGdeQXVyNzI1NzMxNzM@._V1_.jpg', 4, '2024-02-01 01:40:20.931', '2024-02-01 01:40:20.931', 88, 82, 'https://www.rottentomatoes.com/m/nomadland'),
('tt3892172', 2018, 'Leave No Trace', 'Sem Rastros', 'Um pãe e sua filha de trece anos vivem uma vida cheia de paz, mas se ve ameaçada para sempre.', 14, 7.1, 100, 'https://m.media-amazon.com/images/M/MV5BMjE3OTI1MTU0OV5BMl5BanBnXkFtZTgwNTg1MzkzNTM@._V1_.jpg', 4, '2024-02-01 01:40:13.546', '2024-02-01 01:40:13.546', 88, 79, 'https://www.rottentomatoes.com/m/leave_no_trace'),
('tt2935510', 2019, 'Ad Astra', 'Ad Astra: Rumo às Estrelas', 'Um astronauta viaja as bordas do sistema solar para encontrar seu pai e desvendar um mistério que ameaça a sobrevivência do nosso planeta.', 14, 6.5, 83, 'https://m.media-amazon.com/images/M/MV5BZTAxYzg1YzAtZDI3YS00MWE3LWEzNDQtMzlkNGI4MjEyODQ3XkEyXkFqcGdeQXVyMTAzMDM4MjM0._V1_.jpg', 4, '2024-02-01 01:40:13.742', '2024-02-01 01:40:13.742', 80, 40, 'https://www.rottentomatoes.com/m/ad_astra'),
